import React from 'react';
import './Navbar.css';
import { Tabs, Tab, TabList, TabPanel } from 'react-tabs';
// import 'react-tabs/style/react-tabs.css';

export default function Navbar() {
  return (
    <React.Fragment>
      <Tabs>
        <TabList>
          <Tab>Home</Tab>
          <Tab>About</Tab>
        </TabList>
        <TabPanel>
          <div>Helene Mace</div>
        </TabPanel>
        <TabPanel>
          <div>About goes here</div>
        </TabPanel>
      </Tabs>

    </React.Fragment>
  )
}
